'''
本地调试发现,deepcopy特别占用时间和空间

93 / 117 个通过测试用例
状态：超出时间限制
提交时间：10 分钟前

Binary Search + BFS + Memo
'''

from typing import List
from copy import deepcopy
from collections import deque

class Solution:
    def latestDayToCross(self, row: int, col: int, cells: List[List[int]]) -> int:
        N = row * col
        states = []
        state = [[0] * col for _ in range(row)]
        
        states.append(deepcopy(state))
        for i, cell in enumerate(cells):
            print('i: ', i)
            r, c = cell[0] - 1, cell[1] - 1
            state[r][c] = 1
            states.append(deepcopy(state))
        
        #print(states)
        dirs = [(-1, 0), (1, 0), (0, -1), (0, 1)]  #  all directions, including upward
        def inArea(x, y):
            return 0 <= x < row and 0 <= y < col
        
        def check(idx):
            # matrix
            print('check: ', idx)
            m = states[idx]
            q = deque([(0, j) for j in range(col) if m[0][j] == 0])
            # set visited!!!!
            m[0][:] = [1] * col
            while q:
                x, y = q.popleft()
                for dx, dy in dirs:
                    nx, ny = x + dx, y + dy
                    if inArea(nx, ny) and m[nx][ny] == 0:
                        if nx == row - 1:
                            return True
                        q.append((nx, ny))
                        # set visited!!!! DO NOT FORGET!! otherwise, TLE!!!
                        m[nx][ny] = 1
                
            return False
        
        # binary search
        l, r = 0, N
        ans = 0
        while l <= r:
            mid = l + ((r - l) >> 1)
            if check(mid):
                #print('check: ', mid)
                l = mid + 1
                ans = mid
            else:
                r = mid - 1
        
        return ans



